import React,{useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function List(props) {
const[data, setData] = useState([props])
useEffect(()=>{
setData[{props}]
})
  return (
    <div className="">
      {props.value}
    </div>
  );
}

export default List;
